us/">About EasyMed</a></li>\r\n<li id="menu-item-202" class="menu-item menu-item-type-post_type menu-item-object-page menu-item-202"><a href="http://easymedmobile.com/about-us/management-team/">Management Team</a></li>\r\n<li id="menu-item-820" class="menu-item menu-item-type-post_type menu-item-object-page menu-item-820"><a href="http://easymedmobile.com/contact-us/">Contact Us</a></li>\r\n</ul>\r\n</li>\r\n</ul>\r\n</div>\r\n<div class="header-content" style="background: url(''http://easymedmobile.com/wp-content/uploads/2012/07/Phones.png'') no-repeat; background-position: 480px 10px;">\r\n<h1>Hospitals, clinics, private practices</h1>\r\n<h2>Dramatically improve patient care</h2>\r\n<p>Reduce your costs starting in the first month.</p>\r\n<p>EasyMed answers today&rsquo;s most pressing needs in healthcare: better service with lower costs. Easy to implement &ndash; we&rsquo;ll do it for you.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div class="container">\r\n<div class="main-content">\r\n<div class="text-block red">\r\n<h3>International Medical Passport</h3>\r\n<p>Medical records accessible worldwide by smartphone &ndash; a critical service for all business travellers.</p>\r\n<p class="link">Learn More &rarr;</p>\r\n</div>\r\n \r\n<div class="text-block blue">\r\n<h3>Easy SmartCare</h3>\r\n<p>Automate all patient reminders. Immediate cost savings for all medical offices.</p>\r\n<p class="link">Learn More &rarr;</p>\r\n</div>\r\n \r\n<div class="text-block green">\r\n<h3>Smart Technology</h3>\r\n<p>Cloud-based, secure, compliant and accessible on iPhone, Android, Windows and Blackberry platforms.</p>\r\n<p class="link">Learn More &rarr;</p>\r\n</div>\r\n<div class="execphpwidget">\r\n<div class="investor-center">\r\n<h3>Investor Center</h3>\r\n<p>EasyMed Technologies (CNSX: EZM) (OTCBB: EMYSF) is a first mover in the rapidly expanding field of telehealth services.</p>\r\n<p>The sky-rocketing cost of healthcare has all countries looking for answers to cut costs while maintaining services.</p>\r\n<p>EasyMed products answer this pressing need.</p>\r\n<div class="newsletter-signup-block">\r\n<h3>Stay up to date</h3>\r\n<p>Subscribe to the latest breaking EasyMed news and alerts.</p>\r\n<form class="newsletter-signup validate" action="http://easymedmobile.us5.list-manage1.com/subscribe/post" method="POST" target="_blank">\r\n<div id="mergeTable" class="mergeTable">\r\n<p><input id="group_1" checked="checked" name="group[3921][1]" type="checkbox" value="1" />&nbsp;<label style="color: #fff;" for="group_1">EasyMed Newsletter</label><br /> <input id="group_2" checked="checked" name="group[3921][2]" type="checkbox" value="1" />&nbsp;<label style="color: #fff;" for="group_2">EasyMed Press Releases</label><br /> <input id="group_4" checked="checked" name="group[3921][4]" type="checkbox" value="1" />&nbsp;<label style="color: #fff;" for="group_4">Industry News</label></p>\r\n<p><input id="MERGE1" class="email" style="width: 284px;" name="MERGE1" size="25" type="text" value="First Name" /></p>\r\n<p><input id="MERGE2" class="email" style="width: 284px;" name="MERGE2" size="25" type="text" value="Last Name" /></p>\r\n<p><input id="MERGE0" class="email" name="MERGE0" size="25" type="email" value="Email Address" /></p>\r\n</div>\r\n</form></div>\r\n</div>\r\n</div>\r\n<div class="news-releases">\r\n<h3><a href="http://easymedmobile.com/category/press-releases/">Press Releases</a></h3>\r\n<ul>\r\n<li><a href="http://easymedmobile.com/2013/12/easymed-announces-shares-for-debt-settlement/"> December 17, 2013 EasyMed Announces Shares for Debt Settlement </a></li>\r\n<li><a href="http://easymedmobile.com/2013/11/easymed-implements-its-easy-smartcare-technology-in-the-cardiology-department-of-university-hospital-geneva-hug/"> November 14, 2013 EasyMed implements its Easy SmartCare technology in the cardiology department of University Hospital Geneva (HUG). </a></li>\r\n<li><a href="http://easymedmobile.com/2013/10/name-change-and-consolidation-easymed-services-inc-ezm/"> October 21, 2013 CNSX: 2013-1009-Name Change and Consolidation-EasyMed Services Inc. (EZM) </a></li>\r\n<li><a href="http://easymedmobile.com/2013/10/easymed-share-consolidation-and-name-change/"> October 18, 2013 EasyMed Share Consolidation and Name Change </a></li>\r\n</ul>\r\n</div>\r\n<div class="execphpwidget">\r\n<div class="news-releases testimonials" style="margin-right: 0;">\r\n<h3>This Swiss clinic already benefits from Easy SmartCare</h3>\r\n<p><a href="http://easymedmobile.com/easy-smartcare/">Read more &rarr;</a></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div class="footer">\r\n<div class="container">\r\n<div id="nav-footer" class="menu-main-nav-container">\r\n<ul id="menu-main-nav-1" class="nav-footer">\r\n<li class="menu-item menu-item-type-post_type menu-item-object-page menu-item-29"><a href="http://easymedmobile.com/international-medical-passport/">Medical Passport</a>\r\n<ul class="sub-menu">\r\n<li class="menu-item menu-item-type-post_type menu-item-object-page menu-item-783"><a href="http://easymedmobile.com/international-medical-passport/">About Medical Passport</a></li>\r\n<li class="menu-item menu-item-type-post_type menu-item-object-page menu-item-36"><a href="http://easymedmobile.com/international-medical-passport/passport-features/">Passport Features</a></li>\r\n<li class="menu-item menu-item-type-post_type menu-item-object-page menu-item-60"><a href="http://easymedmobile.com/international-medical-passport/working-with-passport/">Working with Passport</a></li>\r\n<li class="menu-item menu-item-type-post_type menu-item-object-page menu-item-186"><a href="http://easymedmobile.com/international-medical-passport/pricing/">Pricing</a></li>\r\n<li class="menu-item menu-item-type-post_type menu-item-object-page menu-item-712"><a href="http://easymedmobile.com/international-medical-passport/medical-passport-free-trial/">Passport Free Trial</a></li>\r\n<li class="menu-item menu-item-type-cu